import { useHistory } from "react-router-dom";

const NavOption = ({ text  }) => {
    const history = useHistory();

    return ( 
        <>
      <button className="py-4 bg-red-500 mx-1 cursor-pointer hover:bg-red-800 px-8 text-white duration-200 rounded-sm" onClick={(()=>{history.push("/"+text)})}>{text}</button>

        </>
    )

}
export default NavOption;
